import React from 'react'
import { NNavLink } from 'react-router-dom'

const MenuIcon = ({link, icon}) => {
  return (
    <NavLink className="menu-icon" to={link}>
        <i className={icon}></i>
    </NavLink>
  )
}

export default MenuIcon
